  false,\n\t\"url\": null,\n\t\"notes\": \"One portion of this intensive program deals
  with the history of the run and the effect of the fishery, with greatest emphasis
  on Bristol Bay and Kodiak Island red salmon. This requires analysis of past catch,
  and escapement records and is described in another Plan of Operations. This Plan
  of Operations covers field work to be accomplished in certain Bristol Bay and Kodiak
  areas by the Bureau of Commercial Fisheries. The Fisheries Research Institute of
  the University of Washington (under contract to the Bureau) will conduct complementary
  field research in other Bristol Bay and Alaska Peninsula areas, namely the Wood
  River, the Kvichak, and the Chignik systems.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
